        {/*<rect x="468" y="279" rx="2" ry="2" width="211" height="211" />*/}

    </ContentLoader>
)

ImageGrid.metadata = {
    name: 'Hassan Tijani.A',
    github: 'surepeps',
    description: 'Image Grid with Pagination',
    filename: 'ImageGrid',
}

export default ImageGrid
